//ContactUs.js
import React , {Component} from 'react';

class ContactUs extends Component{
    render(){
        return (
            <section class="custom-icon-apply-from">
                <div class="container">
                    <div class="custom-strip">
                        <div class="custom-icon-head">
                            <h3>  Do You Want A Custom Icons For <br/>Your Website And Apps? </h3>
                        </div>
                        <div class="custom-contact center-btnn">
                            <a href="index.php" class="btn large-bt">contact us</a>
                        </div>
                    </div>
                </div>
            </section>
        )
    }
}

export default ContactUs;
